        this.props.history.push('')
    }

    render(){

        return(
            
            <header>

                <nav class="navbar navbar-light bg-light">

                    <a class="navbar-brand" href="#">
                       <img src="https://cdn.logo.com/hotlink-ok/logo-social.png" width="30" height="30" class="d-inline-block align-top" alt=""/>
                       שם אתר
                    </a>

                    <button onClick={this.loginClicked}>כניסה</button>

                    <div class="dropdown">

                        <button class="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenu2" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                         שפה
                        </button>

                        <div class="dropdown-menu" aria-labelledby="dropdownMenu2">
                            <button class="dropdown-item" type="button">עברית</button>
                            <button class="dropdown-item" type="button">אנגלית</button>
                            <button class="dropdown-item" type="button">רוסית</button>
                         </div>

                    </div>

                </nav>
                
            </header>
            
        )
    }
}

export default withRouter(Header)
